> Dependency injection is when you don't use strings for your configurations but use object construction and injection. You don't need to use a constructor to get a value but use a method to create it. This way you can pass the value from another object.

It's like this. When you have a constructor with a string parameter and you need to set the value of it you have to call the constructor and pass the value like this:
```public MyClass(string param)
{
    this.MyProperty = param;
}
```
But you don't need to do it like that, you can create a method with a parameter and use the value from another object without having to call the constructor again. Like this:
```public MyClass(MyValue objValue)
{
    this.MyProperty = objValue.MyProperty;
}
```
